complete_model_interaction.output:
Step-by-step reasoning:
1. Key psychological mechanism: In the responder role of the ultimatum game, individuals care not only about their monetary gain (their own share, split_self) but also about the fairness of the allocation relative to the proposer (split_opp). In the Fehr–Schmidt model, responders experience a disutility proportional to the amount by which their share exceeds the opponent’s share. Since in our dataset split_self is always greater than split_opp, the disadvantageous inequality term (envy) is zero and we only need to include the parameter for advantageous inequality.
2. Interaction: The utility of accepting an offer is reduced by a fairness cost proportional to the difference (split_self – split_opp); if this difference is large, even though the monetary gain is higher, the perceived unfairness may make acceptance less attractive.
3. Mathematical form: The utility when accepting can be modeled as U_accept = split_self – beta · (split_self – split_opp), where beta is a learnable parameter that quantifies the aversion to advantageous inequality.
4. Learnable parameters: Only one learnable parameter is needed. Here beta is the single parameter and it is given generous finite bounds (e.g., [0, 10]).
5. Mapping to behavior: If U_accept is negative, the offer is unlikely to be accepted; if it is positive, it is more likely that the responder accepts. The utility serves as the input in any further softmax or logistic transformation in a full choice model.

The final formal model is provided below.

<MODEL>
U_accept = split_self - beta * (split_self - split_opp)
</MODEL>

