A model of responder behavior based on the Fehr–Schmidt framework that computes the utility of accepting an offer. The utility is the monetary gain adjusted by a fairness cost proportional to the difference between the responder’s and proposer’s shares, with a single learnable parameter (beta) capturing advantageous inequality aversion.
</SUMMARY>

